import { Routes, Route } from "react-router-dom";

import Topbar from "./component/topbar/Topbar";
import Navbar from "./component/navbar/Navbar";

function App() {
  return (
    <>
    <Topbar/>
      <Navbar/>
      <Routes>
        <Route path="/" element={<Home />} />
        {/* <Route path="/about" element={<About />} /> */}
      </Routes>
    </>
  );
}

export default App;
